components:
  schemas:
    YOLODetectedObject:
      type: object
      properties:
        class_id:
          type: integer
        confidence:
          type: number
          examples:
            - 0.114514
        bbox:
          type: array
          items:
            type: integer
          minItems: 4
          maxItems: 4
      required:
        - class_id
        - confidence
        - bbox
    InferYOLOResponse:
      type: object
      properties:
        class_names:
          type: array
          items:
            type: string
        results:
          type: array
          items:
            type: array
            items:
              $ref: '#/components/schemas/YOLODetectedObject'
      required:
        - results
    ModelList:
      type: object
      properties:
        yolo:
          type: array
          items:
            type: string
        ocr:
          type: array
          items:
            type: string
      required:
        - yolo
        - ocr
    InferYOLORequest: &ref_0
      type: object
      properties:
        model:
          type: string
        images:
          type: array
          items:
            type: string
            description: base64编码的图片
      required:
        - model
        - images
    InferOCRRequest: *ref_0
    InferOCRResponse:
      type: object
      properties:
        results:
          type: array
          items:
            type: array
            items:
              $ref: '#/components/schemas/OCRLine'
      required:
        - results
    OCRLine:
      type: object
      properties:
        bbox:
          type: array
          items:
            type: integer
          minItems: 4
          maxItems: 4
        confidence:
          type: number
        line:
          type: string
      required:
        - bbox
        - confidence
        - line
  securitySchemes: {}
